// src/pages/dashboard/ProfileLayout.js
import React from 'react';
import { Outlet } from 'react-router-dom'; // This renders child routes

const ProfileLayout = () => {
  return (
    <div className="profile-layout">
      <h1>Dashboard</h1>
      <div className="dashboard-menu">
        {/* Add any sidebar or menu links here */}
      </div>
      <div className="dashboard-content">
        <Outlet /> {/* This will render the active route's component (like UserProfile, OrdersPage, etc.) */}
      </div>
    </div>
  );
};

export default ProfileLayout;
